        "title": "Rhigos ambulance crash: Tributes to 'devoted dad' Jeff Rawle",
        "body": "<p>The family of a 47-year-old who died after his car collided with an ambulance have said his death \"leaves a massive hole in our hearts\".</p><p>Jeff Rawle, from Treherbert, Rhondda Cynon Taf, died at the scene of the crash on Rhigos Mountain Road at about 19:00 GMT on Thursday.</p><p>Mr Rawle's family said they were \"completely devastated\" by his death.</p><p>The passenger in his car remains in a serious but stable condition at Cardiff's University Hospital of Wales.</p><p>The 52-year-old ambulance driver was taken to the Royal Glamorgan Hospital, where he was treated for minor injuries, but has since been discharged. </p><p>Mr Rawle's family said he was a \"loving son, brother and devoted dad\" to his daughter Gabby who \"loved him beyond words\".</p><p>\"His sudden death has left a massive hole in our hearts and lives and we as a family are completely devastated as we try and make sense of what has happened,\" they said.</p><p>\"He was loved and liked by so many. He will be missed.\"</p><p>South Wales Police is continuing to investigate the cause of the crash.</p>"
